import styled from 'styled-components'
import Image from 'next/image'

const CheckList = () => {

    return (
        <Container>
            <ContainerImage>
                <Image
                    src="/coding.png"
                    width={500}
                    height={500}
                />
            </ContainerImage>

            <Container>
                <ul>
                    <li>Dom√≠nio personalizado</li>
                    <li>Hospedagem</li>
                    <li>Site responsivo</li>
                    <li>Redes sociais</li>
                    <li>Chat online</li>
                    <li>Blog integrado</li>
                </ul>
            </Container>
        </Container>
    )

}

const Container = styled.div` 
    display: flex;
    flex-direction: column;
    align-items: 'space-between';
`

const ContainerImage = styled.div`
    height: 60%;
    width: 60%;
    max-width: 300px;
    max-height: 300px;
`
const list = styled.li`
    font-size: 1.5em;
    font-weight: bold;
    

`


export default CheckList
